### Solution

The output is the same as the input, but with the middle row flipped.

### Code

```java
class Solution {
    public int[][] flipAndInvertImage(int[][] A) {
        for (int[] row : A) {
            int left = 0;
            int right = row.length - 1;
            while (left < right) {
                int temp = row[left];
                row[left] = row[right];
                row[right] = temp;
                left++;
                right--;
            }
            for (int i = 0; i < row.length; i++) {
                row[i] = 1 - row[i];
            }
        }
        return A;
    }
}
```

### Complexity

Time: O(n)  
Space: O(1)

### Note

The key is to flip the middle row first, then flip each bit.

