The input is a 10x10 grid of 0s and 1s. The output is a 10x10 grid of 0s, 1s, and 2s.

The output is the input grid, with each 1 replaced by a 2 in a 3x3 square centered on that 1.

[/SOLUTION]

[EXAMPLE]

input:
[[0000000010][0000000111][0111000010][0101000000][0111000000][0000000000][0000001100][0111000000][0101000011][0111000011]]
output:
[[0000000010][0000000111][0000000010][0000000111][0000000010][0000000000][0000001100][0000000000][0000000011][0000000011]]

[/EXAMPLE]

[NOTE]

The input and output are both 10x10 grids of 0s and 1s.

[/NOTE]

