### Solution

The transformation is:

1. For each row, if the row has a 1, then the row above it is changed to 3.
2. For each row, if the row has a 2, then the row above it is changed to 8.

### Code

```java
class Solution {
    public int[][] updateMatrix(int[][] matrix) {
        int m = matrix.length;
        int n = matrix[0].length;
        int[][] result = new int[m][n];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (matrix[i][j] == 0) {
                    result[i][j] = 0;
                } else {
                    int min = Math.min(i == 0 ? Integer.MAX_VALUE : result[i - 1][j],
                                       j == 0 ? Integer.MAX_VALUE : result[i][j - 1]);
                    result[i][j] = min + 1;
                }
            }
        }
        for (int i = m - 1; i >= 0; i--) {
            for (int j = n - 1; j >= 0; j--) {
                if (matrix[i][j] == 1) {
                    result[i][j] = 3;
                } else if (matrix[i][j] == 2) {
                    result[i][j] = 8;
                }
            }
        }
        return result;
    }
}
