### Solution

The input is a 13x13 matrix of 0s, 1s and 2s.

The output is a 13x13 matrix of 0s, 1s, 2s and 3s.

The output is the same as the input except that each 2 is replaced by a 3 if it is surrounded by 1s.

### Code

```java
class Solution {
    public int[][] floodFill(int[][] image, int sr, int sc, int newColor) {
        int[][] dirs = new int[][]{{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{sr, sc});
        int oldColor = image[sr][sc];
        while (!queue.isEmpty()) {
            int[] cell = queue.poll();
            int r = cell[0], c = cell[1];
            if (image[r][c] == oldColor) {
                image[r][c] = newColor;
                for (int[] dir : dirs) {
                    int nr = r + dir[0], nc = c + dir[1];
                    if (nr >= 0 && nr < image.length && nc >= 0 && nc < image[0].length && image[nr][nc] == oldColor) {
                        queue.offer(new int[]{nr, nc});
                    }
                }
            }
        }
        return image;
    }
}
```

