### Code

```
#include <iostream>
#include <vector>
using namespace std;

void print_board(vector<vector<int>> board) {
    for (int i = 0; i < board.size(); i++) {
        for (int j = 0; j < board[i].size(); j++) {
            cout << board[i][j] << " ";
        }
        cout << endl;
    }
}

vector<vector<int>> rotate_board(vector<vector<int>> board) {
    vector<vector<int>> new_board;
    for (int i = 0; i < board.size(); i++) {
        vector<int> new_row;
        for (int j = 0; j < board[i].size(); j++) {
            new_row.push_back(board[i][j]);
        }
        new_board.push_back(new_row);
    }
    return new_board;
}

vector<vector<int>> rotate_board_2(vector<vector<int>> board) {
    vector<vector<int>> new_board;
    for (int i = 0; i < board.size(); i++) {
        vector<int> new_row;
        for (int j = 0; j < board[i].size(); j++) {
            new_row.push_back(board[i][j]);
        }
        new_board.push_back(new_row);
    }
    return new_board;
}

int main() {
    vector<vector<int>> board = {{0, 0, 0}, {5, 0, 5}, {5, 5, 5}};
    print_board(board);
    print_board(rotate_board(board));
    print_board(rotate_board_2(board));
}
```

