### Discussion

The problem is to rotate a matrix by 90 degrees.

The first solution is to create a new matrix, and then copy the elements from the original matrix to the new matrix.

The second solution is to create a new matrix, and then copy the elements from the original matrix to the new matrix, but in reverse order.

The first solution is O(n^2) time and O(n^2) space.

The second solution is O(n^2) time and O(1) space.

