function solution(board) {
  const boardSize = board.length;
  const boardSizeHalf = Math.floor(boardSize / 2);
  const boardSizeQuarter = Math.floor(boardSizeHalf / 2);
  const boardSizeThreeQuarter = boardSize - boardSizeQuarter;
  const boardSizeThreeQuarterMinusOne = boardSizeThreeQuarter - 1;

  for (let i = 0; i < boardSize; i++) {
    for (let j = 0; j < boardSize; j++) {
      const currentValue = board[i][j];
      const currentValueStr = currentValue.toString();
      const currentValueLength = currentValueStr.length;

      if (currentValueLength === 1) {
        continue;
      }

      let newValue = 0;
      let newValueStr = '';

      if (i < boardSizeQuarter) {
        if (j < boardSizeQuarter) {
          newValue = currentValue + board[i + 1][j] + board[i][j + 1];
        } else if (j > boardSizeThreeQuarterMinusOne) {
          newValue = currentValue + board[i + 1][j] + board[i][j - 1];
        } else {
          newValue = currentValue + board[i + 1][j] + board[i][j - 1] + board[i][j + 1];
        }
      } else if (i > boardSizeThreeQuarterMinusOne) {
        if (j < boardSizeQuarter) {
          newValue = currentValue + board[i - 1][j] + board[i][j + 1];
        } else if (j > boardSizeThreeQuarterMinusOne) {
          newValue = currentValue + board[i - 1][j] + board[i][j - 1];
        } else {
          newValue = currentValue + board[i - 1][j] + board[i][j - 1] + board[i][j + 1];
        }
      } else {
        if (j < boardSizeQuarter) {
          newValue = currentValue + board[i - 1][j] + board[i + 1][j] + board[i][j + 1];
        } else if (j > boardSizeThreeQuarterMinusOne) {
          newValue = currentValue + board[i - 1][j] + board[i + 1][j] + board[i][j - 1];
        } else {
          newValue = currentValue + board[i - 1][j] + board[i + 1][j] + board[i][j - 1] + board[i][j + 1];
        }
      }

      newValueStr = newValue.toString();

      if (newValueStr.length > currentValueLength) {
        newValueStr = newValueStr.slice(1);
      }

      board[i][j] = parseInt(newValueStr, 10);
    }
  }

  return board;
}
